import { FormControl, FormLabel, VStack,Input, InputGroup, InputRightElement, Button } from '@chakra-ui/react'
import React from 'react'
import { useState } from 'react'
import { useToast } from '@chakra-ui/react'
import { Cloudinary } from '@cloudinary/url-gen';
import cloudinary from 'cloudinary';

const Signup = () => {
    const [show, setShow] = useState(false);
    const [name, setName] = useState();
    const [email, setEmail] = useState();
    const [confirmpassword, setConfirmpassword] = useState();
    const [password, setPassword] = useState();
    const [pic, setPic] = useState();
    const [Loading, setLoading] = useState(false);
    const toast = useToast();
     
    const handleClick = () => setShow(!show);

    const cloudinaryConfig = {
      cloud_name: 'djhhjtpno',
      api_key: '884665552235599',
      api_secret: 'psk4v-Qc3HoBNtZbd-eSU-UgJpA',
    };

    cloudinary.config(cloudinaryConfig);
    const postDetails = (pics) => {
      setLoading(true);
      if (pics === undefined) {
        toast({
          title: "Please select an image",
          status: "warning",
          duration: 5000,
          isClosable: true,
          position: "bottom"
        });
        return;
      }
      if (pics.type === "image/jpeg" || pics.type === "image/png") {
        const cld = new Cloudinary({ cloud: { cloudName: 'djhhjtpno' } });
        const uploadParams = {
          file: pics,
          upload_preset: 'TextMe'
        };
        cld.uploader.upload(uploadParams)
         .then((result) => {
            setPic(result.url.toString());
            setLoading(false);
          })
         .catch((err) => {
            console.log(err);
            setLoading(false);
          });
      } else {
        toast({
          title: "Please select an image",
          status: "warning",
          duration: 5000,
          isClosable: true,
          position: "bottom"
        });
        setLoading(false);
        return;
      }
    };
